  [],\n\t\"revision_timestamp\": \"2015-05-07T06:07:26.707094\",\n\t\"name\": \"high-power-density-sofcs-for-aviation-applications-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"As solid oxide fuel cells (SOFCs) approach
  commercialization, interest in broader applications of this technology is mounting.
  \ While the first commercialized systems are being designed to provide 3-5 kW in
  stationary and automotive auxiliary power unit (APU) applications, aerospace and
  military users are considering integrating SOFCs into larger, airborne systems with
  considerable commercial payback.  SOFCs are aligned to displace inefficient, noisy,
  and polluting technologies such as diesel generators that will provide both economic
  and environmental motivation to prospective users.  NexTech Materials will develop
  a solid oxide fuel cells that demonstrate high power density, targeting 2W/cm2,
  a level of performance that will enable the compact, lightweight systems required
  for aerospace applications to become a reality.  Such high power density SOFCs will
  provide the bridge from stationary residential power systems to airborne auxiliary
  power units.  The fuel cells that result from these applications will lead the way
  to efficient and clean aircraft.  This Phase I work will focus on processing and
  evaluating highly conductive electrolyte and electrode materials and the incorporation
  of these materials into high power density, SOFC cells suitable for commercial stack
  fabrication in Phase II.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
